INSERT INTO `products_description` VALUES (396, 1, 'Loud 0178 - Escape Dk', 'A gloriously rich, multi-coloured yarn that creates wonderfully subtle stripes as you knit. Escape Dk comes in a beautifully soft, wool rich blend and is machine washable. Escape Dk will knit to all Sirdar Dk patterns.', '', 511);
INSERT INTO `products_description` VALUES (929, 4, '', '', '', 0);
INSERT INTO `products_description` VALUES (929, 1, 'Shaggy Scarf Brown Mix - 0607', 'Shaggy scarf is a shaggy-textured, two-colour yarn that knits up quickly on 20mm needles. There are 10 stunning colours with black and white, tonal blues, purples and pinks as well as browns and beiges.The ball band has a free pattern to knit either one bigger ladies scarf or two smaller girl''s size scarves. Shaggy scarves make perfect presents for chilly autumn days and are great first knits for beginners.\r\n98%Acrylic/2%Nylon50g\r\n150g(30m)/ball', '', 48);
