INSERT INTO `products_description` VALUES (933, 1, 'Softspun DK Ivory - 550', 'Sirdar Softspun DK is a delicate, soft yarn with a gorgeous, silvery lustre running through each shade. It creates beautifully soft and lightweight knits, and with 137 yards on a 25g ball, many of our designs knit from just a few balls. This stunning yarn comes in 10 incredible colours  including the elegant pale shades of silver, ivory, camel, aqua and pink or our dramatic black, blue and purple  and creates the most delicate, chic hand knits for stylish winter dressing.\r\n51%Nylon/25%Wool/24%Acrylic', '', 49);
INSERT INTO `products_description` VALUES (389, 1, 'Tease 0195 - Escape Chunky', 'Escape Chunky is a gloriously vibrant, multi-coloured yarn that creates a wonderful colour change effect as you knit. It comes in a beautifully soft, wool rich blend and is machine washable. This yarn knits to our standard chunky tension and will knit to all Sirdar chunky patterns.\r\n50g ball', '', 79);
