INSERT INTO `products_description` VALUES (379, 1, 'Crazy Horse 0157 - Indie', 'Sirdar INDIE is a gorgeous, light and lofty yarn with a riot of magnificent colours in every ball - the fabulous colour effect appears as you knit. INDIE comes in a beautifully lightweight blend of 51% wool and 49% acrylic and comes in a conventional 50g ball. INDIE is fantastically quick to knit on 12mm needles and is easy for children and new knitters alike.', '', 84);
