INSERT INTO `products_description` VALUES (371, 1, 'Irish Rose 0357 - Connemara Chunky', 'Inspired by the wistful and romantic west coast of Ireland, Connemara chunky is a breathtaking, softly coloured tweed effect yarn. It comes in 6 hushed shades with misty blues, gentle heathers and natural smoky browns &mdash; a beautiful palette of tweedy colours for men, women and girls.  Connemara is a true chunky yarn that knits on 6&frac12; mm needles and can be knitted to all our chunky patterns. It comes in a beautifully natural, wool rich blend of 51% wool 49% acrylic, in a conventional 50g ball. Connemara''s gorgeous tweedy colours look fabulous knitted into the simplest stocking stitch, cables and textures.', '', 65);
