INSERT INTO `products_description` VALUES (1058, 1, 'Baby Speckle DK - 0122', 'Snuggly Baby Speckle DK is a cotton-rich blend made with 60% cotton and 40% acrylic and comes in a range of beautifully soft and speckled shades. It is a standard double knitting yarn and will knit to all Sirdars double knitting designs, not just for babies, toddlers and children, but for adults too.\r\nThis gorgeous yarn is beautifully soft to knit and to wear next to your skin. It creates covetable, cottony hand knits in stylish colours and is easy care and machine washable too.\r\n50g(135m)/ball', '', 6);
