INSERT INTO `products_description` VALUES (913, 1, 'Seagrass 045 - Crofter DK', 'Crofter Dk is a beautifully soft, standard Dk yarn that has an incredible Fair Isle effect spray dyed onto the yarn - so the yarn knits as normal and the beautiful Fair Isle effect appears as you knit. You get the look of Fair Isle without the hard work!', '', 108);
INSERT INTO `products_description` VALUES (914, 4, '', '', '', 0);
INSERT INTO `products_description` VALUES (914, 1, 'Forbidden 0196 - Escape Chunky', 'Escape Chunky is a gloriously vibrant, multi-coloured yarn that creates a wonderful colour change effect as you knit. It comes in a beautifully soft, wool rich blend and is machine washable. This yarn knits to our standard chunky tension and will knit to all Sirdar chunky patterns.\r\n50g ball', '', 93);
INSERT INTO `products_description` VALUES (915, 4, '', '', '', 0);
INSERT INTO `products_description` VALUES (915, 1, 'Oregon Trail 0160 - Indie', 'Sirdar INDIE is a gorgeous, light and lofty yarn with a riot of magnificent colours in every ball - the fabulous colour effect appears as you knit. INDIE comes in a beautifully lightweight blend of 51% wool and 49% acrylic and comes in a conventional 50g ball. INDIE is fantastically quick to knit on 12mm needles and is easy for children and new knitters alike.', '', 116);
