INSERT INTO `products_description` VALUES (707, 1, 'Phoenix 0159 - Indie', 'Sirdar INDIE is a gorgeous, light and lofty yarn with a riot of magnificent colours in every ball - the fabulous colour effect appears as you knit. INDIE comes in a beautifully lightweight blend of 51% wool and 49% acrylic and comes in a conventional 50g ball. INDIE is fantastically quick to knit on 12mm needles and is easy for children and new knitters alike.', '', 105);
INSERT INTO `products_description` VALUES (708, 1, 'Nevada 0158 - Indie', 'Sirdar INDIE is a gorgeous, light and lofty yarn with a riot of magnificent colours in every ball - the fabulous colour effect appears as you knit. INDIE comes in a beautifully lightweight blend of 51% wool and 49% acrylic and comes in a conventional 50g ball. INDIE is fantastically quick to knit on 12mm needles and is easy for children and new knitters alike.', '', 174);
INSERT INTO `products_description` VALUES (709, 1, 'Kinky Pink 0600 - Squiggle Super Chunky', 'Squiggle super chunky is a fabulously colourful yarn that comes in a gorgeous range of jolly colour twist shades for women and girls. Squiggle is a cosy blend of 51% wool and 49% acrylic, which is machine washable and easy care. Squiggle super chunky comes in a conventional 50g ball and knits on 10mm needles. This fabulous yarn is easy and fun to knit and is great for quick projects and the ideal yarn for beginners to use.', '', 173);
