INSERT INTO `products_description` VALUES (835, 1, 'Plaid 0055 - Crofter Chunky', 'Crofter Chunky is a beautifully soft, standard Chunky yarn that has an incredible Fair Isle effect spray dyed onto the yarn - so the yarn knits as normal and the beautiful Fair Isle effect appears as you knit. You get the look of Fair Isle without the hard work!', '', 43);
