INSERT INTO `products_description` VALUES (803, 1, 'Firefly Metallic - 0150', 'We have had an avalanche of requests for us to re-introduce our fabulously delicate Firefly quality?? plus, we thought we?d go one better and have created a new Firefly Metallic too!\r\nThere are 6 of the most gorgeous original shades in Firefly and 6 new shades in Firefly Metallic, with a sensational metallic thread. With an emphasis on delicate knits for evening we have an elegant cowl neck top (9474) and 3 pretty cardie designs ? a simple tie front (9471), a stunning waterfall (9472) and a simple lace short-sleeved style (9473). Lastly, there?s the flattering ribbon tie waistcoat (9470). All these designs are easy to knit and leaflet 9472 includes larger sizes.\r\n93%Nylon/7%Polyester\r\n50g(140m)/ball', '', 397);
INSERT INTO `products_description` VALUES (804, 1, 'Firefly Metallic - 0151', 'Sirdar Firefly is a gorgeously soft, light yarn that comes in a range of 6 dramatic evening colours. We also have 6 shades in the sensational Firefly Metallic ? each with the addition of a fabulous metallic thread. Both yarns come in a fascinating ladder construction and are easy-to-knit on 10mm needles ? they?re designed to create flatteringly delicate hand knits for evening or trendy scarves to add a dash of subtle metallic lustre for every day.\r\n93%Nylon/7%Polyester\r\n50g(140m)/ball', '', 130);
