INSERT INTO `products_description` VALUES (966, 4, '', '', '', 0);
INSERT INTO `products_description` VALUES (966, 1, 'Teddy Mix 114 - Baby Snowball', 'Snuggly Baby Snowball is the softest, cuddliest yarn imaginable &mdash; and creates the cutest baby hand knits and blankets for girls and boys. The yarn has lots of soft and cosy ?snowballs'' and is just so quick and easy to knit on 6 &frac12; mm needles. It comes in the gentlest shades of ice cream and snow white - or gently frosted colours with pretty pink, trendy lilac, blue or green.', '', 147);
INSERT INTO `products_description` VALUES (991, 4, '', '', '', 0);
INSERT INTO `products_description` VALUES (991, 1, 'Bohemia - 0291', 'Bohemia is an easy to knit scarf yarn that comes in 6 inspiring, richly coloured shades including the most beautiful blues, purples, berry reds and 2 multi-mixtures with oranges, purples and blues. It is made from a blend of 66% acrylic and 34% wool, making it soft and cosy to wear and easy to care for. This yarn knits in 20mm needles and theres a free scarf pattern on the ball band.\r\n100g(45m)/ball', '', 53);
INSERT INTO `products_description` VALUES (992, 4, '', '', '', 0);
INSERT INTO `products_description` VALUES (992, 1, 'Elephant Blue 0707 - Snowflake Chunky', 'This is the UK''s favourite soft, fleecy yarn that comes in purest white, cream and trendy baby colours. A truly original yarn from Sirdar.', '', 45);
INSERT INTO `products_description` VALUES (993, 4, '', '', '', 0);
INSERT INTO `products_description` VALUES (993, 1, 'Fairytale Dreamtime 2Ply Pure Wool', 'Fairytale Dreamtime is 100% pure wool making it soft to the touch and delicate for babies and toddlers skin.\r\n2 Ply = 50g Ball (approx 340m)', '', 62);
INSERT INTO `products_description` VALUES (994, 4, '', '', '', 0);
INSERT INTO `products_description` VALUES (994, 1, 'Fairytale Dreamtime 3Ply Pure Wool', '3ply is a classic yarn perfect for making garments and shawls.\r\n100% Pure New Wool\r\n3 Ply = 50g Ball (approx 340m)', '', 65);
