INSERT INTO `sirdar_yarn` VALUES ('F047', 'INC', 'Baby Snowball', 'Fashion', 'Baby', 'f047-large.jpg', 42, 35, 60, 50, 1, 12, '25m/27y', '100% Polyester', 'Snuggly Baby Snowball is the softest, cuddliest yarn imaginable &mdash; and creates the cutest baby hand knits and blankets for girls and boys. The yarn has lots of soft and cosy ?snowballs'' and is just so quick and easy to knit on 6 &frac12; mm needles. It comes in the gentlest shades of ice cream and snow white - or gently frosted colours with pretty pink, trendy lilac, blue or green.', NULL);
INSERT INTO `sirdar_yarn` VALUES ('F050', 'INC', 'Snuggly Tiny Tots Dk', 'Fashion', 'Baby', 'f050-large.jpg', 42, 35, 61, 50, 1, 11, '137m/150y', '90% Acrylic, 10% Polyester', 'This popular standard Dk yarn with a coloured nep adds real texture to baby hand knits. The colours range from pretty pinks to modern stones and browns. Snuggly Tiny Tots Dk will keep its quality through machine washing and tumble drying.', NULL);
INSERT INTO `sirdar_yarn` VALUES ('F017', 'INC', 'Snuggly Snowdrops Chunky', 'Chunky', 'Baby', 'f017-large.jpg', 43, 35, 62, 50, 1, 13, '80m/88y', '60% Acrylic, 40% Polyester', 'Snuggly Snowdrops Chunky is a soft and cosy baby yarn scattered with tiny white ?snowdrops'' and comes in a fabulous range of snow white, cosy cream, biscuit and four pretty baby pastels &mdash; pink, lilac, mint and blue. You can create fabulously quick baby knits using 6mm needles with Snowdrops Chunky &mdash; it is perfect for pretty little cardies, trendy little hats and adorable baby blankets. This cosy baby yarn comes in a blend of 60% acrylic and 40% polyester, making it and machine washable and easy care.', NULL);
