INSERT INTO `sirdar_yarn` VALUES ('F091', 'INC', 'Snowball', 'Fashion', 'Fashion', 'f091-large.jpg', 33, 33, 72, 200, 6, 14, '40m/43y', '100% Polyester', 'Sirdar Snowball makes THE softest, THE quickest and THE most irresistibly cosy scarf! This super-sized pom pom yarn is really quick to knit and creates a scarf that''s out of this world. It''s the over-sized fluffy pom poms that make this yarn just so soft to wear!  You can knit or crochet a women''s scarf from one ball or create two smaller scarves for girls. All you need is a pair of 8mm needles &mdash; it''s only 5 stitches wide. Or you can knit 2 smaller scarves for girls (cast on 4 sts and knit 100 cm which is half the ball), either way they''re incredibly quick to make. We have put ALL the instructions on how to knit the Snowball scarf on the inside of the ball band so you don''t even need to buy a pattern!', NULL);
