INSERT INTO `sirdar_yarn` VALUES ('F034', 'INC', 'Squiggle Super Chunky', 'Fashion', 'Fashion', 'f034-large.jpg', 33, 33, 77, 50, 1, 4, '40m/43y', '51% Wool, 49% Acrylic', 'Squiggle super chunky is a fabulously colourful yarn that comes in a gorgeous range of jolly colour twist shades for women and girls. Squiggle is a cosy blend of 51% wool and 49% acrylic, which is machine washable and easy care. Squiggle super chunky comes in a conventional 50g ball and knits on 10mm needles. This fabulous yarn is easy and fun to knit and is great for quick projects and the ideal yarn for beginners to use.', NULL);
